import React from 'react';
import logo from './logo.svg';
import { Loader } from './features/counter/Counter';
import './App.css';

import { useGetPokemonByIdQuery } from './features/counter/counterAPI.tsx'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Loader />
        {
          useGetPokemonByIdQuery(1)
        }
      </header>
    </div>
  );
}

export default App;
